import randomimport cProfiledef gen_array(n):    return [random.randint(-1000, 1000) for _ in range(n)]def max_from_min1(n: int) -> int:    sub_zero = [i for i in gen_array(n) if i < 0]    num = float('-inf')    for i in sub_zero:        if i > num:            num = i    return numdef max_from_min2(n: int) -> int:    num = float('-inf')    for i in gen_array(n):        if i < 0 and i ** 2 < num ** 2:            num = i    return numdef max_from_min3(n: int) -> int:    num = float('-inf')    for i in gen_array(n):        if num < i < 0:            num = i    return num